export class AppComponent {
  title = 'music-shop';
}
<header>
  <nav>
    <ul>
      <li><a routerLink="/cd">CD</a></li>
      <li><a routerLink="/vinyl">Vinili</a></li>
      <li><a routerLink="/best">Carrello</a></li>
      <li><a routerLink="/give-advice">Dai un consiglio</a></li>
      <!-- Aggiungi qui altri bottoni o link se necessario -->
    </ul>
  </nav>
</header>

